import React from 'react';
import './App.css';
import {BrowserRouter as Router} from 'react-router-dom'
// import NavBar from './component/NavBar';
import AppRouter from './component/AppRouter';
import Nav_Bar from './component/Nav_Bar';

function App() {
  return (
    <>
      <Router>
        <Nav_Bar/>
        <AppRouter/>
      </Router>
    </>
  );
}

export default App;
